import axios from "axios"

export const handleIncident = async (setData) => {
    axios
      .get("https://dev.atmansystems.com/attlas-public/api/Incidents")
      .then((res) => {
        // alert("ok");
        setData(res.data);
      })
      .catch((error) => {
        alert("deu erro");
        console.log(error.response);
      })
  };
